using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public partial struct IconComponentResolver : IResolver<IconComponent>, IResolver<IconComponentResolver,IconComponent>, IData	{		public IconComponentResolver In(ref IconComponent iconcomponent)		{			return this;		}		public void Out(ref Entity entity)		{			var local = entity.GetComponent<IconComponent>();			Out(ref local);		}		public void Out(ref IconComponent iconcomponent)		{		}	}}